import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class MusicCard extends Component {
  getHtmlMusics = () => {
    const { musics } = this.props;
  }

  render() {
    return (
      <div>MusicCard</div>
    );
  }
}

MusicCard.propTypes = {
  musics: PropTypes.shape(),
};
